USE `xpayrolldb`;

/*Table structure for table `tblaccount` */

DROP TABLE IF EXISTS `tblaccount`;

CREATE TABLE `tblaccount` (
  `Employee_ID` int(11) NOT NULL,
  `PositionName` varchar(50) default NULL,
  `Number_of_Days_Work` double default NULL,
  `Bonus` double default NULL,
  `Overtime_pay` double default NULL,
  `Gross_Salary` double default NULL,
  `Cash_Advance` double default NULL,
  `Late_Hours` varchar(50) default NULL,
  `Absent_Days` varchar(50) default NULL,
  `SSS_Contribute` double default NULL,
  `Philhealth` double default NULL,
  `Total_Deduction` double default NULL,
  `Account_ID` varchar(50) default NULL,
  PRIMARY KEY  (`Employee_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tblaccount` */

/*Table structure for table `tblaudit` */

DROP TABLE IF EXISTS `tblaudit`;

CREATE TABLE `tblaudit` (
  `ID` int(11) NOT NULL auto_increment,
  `Login_Name` varchar(11) default '',
  `Date` varchar(50) default '',
  `Status` varchar(50) default '',
  PRIMARY KEY  (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tblaudit` */

/*Table structure for table `tblemployee` */

DROP TABLE IF EXISTS `tblemployee`;

CREATE TABLE `tblemployee` (
  `ID` int(11) NOT NULL auto_increment,
  `FIRSTNAME` varchar(50) default NULL,
  `MIDDLENAME` varchar(50) default NULL,
  `LASTNAME` varchar(50) default NULL,
  `ADDRESS` text,
  `CONTACT` varchar(50) default NULL,
  `GENDER` char(10) default NULL,
  `DATE_OF_BIRTH` varchar(50) default NULL,
  `STATUS` varchar(50) default NULL,
  `PICTURE` longblob,
  PRIMARY KEY  (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tblemployee` */

/*Table structure for table `tbllogin` */

DROP TABLE IF EXISTS `tbllogin`;

CREATE TABLE `tbllogin` (
  `UserID` int(11) NOT NULL auto_increment,
  `Username` varchar(50) default NULL,
  `Password` varchar(50) default NULL,
  `Secretcode` varchar(50) default NULL,
  `Permission` varchar(50) default NULL,
  `Firstname` varchar(50) default NULL,
  `Lastname` varchar(50) default NULL,
  `Contact` varchar(50) default NULL,
  `Picture` longblob,
  PRIMARY KEY  (`UserID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

